import React from 'react';
import { StyleSheet, View} from 'react-native';
import Deck from '../Components/Deck';

const viewDeckList = (decksGroup1, decksGroup2, navigation) => {

    return (
        <>
        {
            decksGroup1.map((deck,index) => {
                return (
                    <View key={deck.title} style={styles.deckGroup}>
                        <Deck deck={decksGroup2[index]} navigation={navigation} />
                        <Deck deck={deck} navigation={navigation} />
                    </View>
                )
            })
        }
        </>
    )
}

export default viewDeckList;

const styles = StyleSheet.create({
    deckGroup: {
        flex: 2,
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "center"
    }
})
